import React from 'react';
import RegisterForm from '../Components/signUpForm'; // Adjust path based on your file structure
import axios from 'axios';

const RegisterPage = () => {
  const handleSubmit = async (formData) => {
    try {
      // Use Axios to send POST request to server
      const response = await axios.post(`http://localhost:9900/users/signup`, formData);
      console.log('Registration successful:', response.data);
    } catch (error) {
      console.error('Registration failed:', error);
    }
  };

  return (
    <div>
      <h1>Register Page</h1>
      <RegisterForm onSubmit={handleSubmit} />
    </div>
  );
};

export default RegisterPage;
